import React from "react";

function List({ contacts }) {
  return (
    <div>
      <ul>
        {contacts.map((contacts, index) => {
          return (
            <div>
              <li key={index}>{contacts.fullName}</li>
              <li key={index}>{contacts.phone}</li>
            </div>
          );
        })}
      </ul>
    </div>
  );
}

export default List;
